            array('id' => '375','nama_auditor' => 'lpmpp','nip' => '198112102008121001','asal_auditor' => 'S1 TEKNIK ELEKTRO','created_at' => '2023-11-17 08:28:35','updated_at' => '2023-11-17 08:28:35')
        );

        foreach ($data as $key => $newData) {
            $role = match ($newData['role']) {
                'admin' => 'Administrator',
                'auditee' => 'Auditee',
                'auditor' => 'Auditor',
                default => $newData['role'],
            };

            if (empty($newData['email'])) {
                $newData['email'] = strtolower($newData['name']) . '@mail.com';  // Membuat email dari name
            }

            // Cek apakah email sudah ada di database
            $email = $newData['email'];
            $emailExists = User::where('email', $email)->exists();

            // Jika email sudah ada, tambahkan angka di belakang email untuk membuatnya unik
            if ($emailExists) {
                $counter = 1;
                // Mengubah email menjadi unik dengan menambahkan angka
                while (User::where('email', $email)->exists()) {
                    $email = preg_replace('/@mail\.com$/', "($counter)@mail.com", $newData['email']);
                    $counter++;
                }
            }

            // Assign email baru ke $newData
            $newData['email'] = $email;

            $unitKerjaId = null;

            // Penanganan khusus untuk auditee
            if ($newData['role'] === 'auditee' && $newData['name'] !== null) {
                $nameParts = explode(' ', $newData['name'], 2);

                if (count($nameParts) >= 2) {
                    $jenjang = strtolower($nameParts[0]);
                    $namaProdi = $nameParts[1];

                    $unitKerja = UnitKerja::where('jenjang', $jenjang)
                        ->where('nama_unit_kerja', 'like', '%' . $namaProdi . '%')
                        ->first();

                    if ($unitKerja) {
                        $unitKerjaId = $unitKerja->id;
                    }
                }
            }

            // Penanganan khusus untuk auditor
            if ($newData['role'] === 'auditor') {
                $matchedAuditor = collect($dataAuditor)->firstWhere('nip', $newData['username']);
                if ($matchedAuditor) {
                    $asalAuditor = $matchedAuditor['asal_auditor'];

                    $unitKerja = UnitKerja::whereRaw('LOWER(TRIM(nama_unit_kerja)) = ?', [strtolower(trim($asalAuditor))])->first();
                    if ($unitKerja) {
                        $unitKerjaId = $unitKerja->id;
                    }
                }
            }

            // Simpan user tanpa memasukkan kolom 'role' ke dalam database
            $user = User::create([
                'name' => $newData['name'],
                'email' => $newData['email'],
                'username' => $newData['username'],
                'password' => $newData['password'],
                'unit_kerja_id' => $unitKerjaId,
                'created_at' => now(),
                'updated_at' => now(),
            ]);

            // Sinkronisasi role ke setiap user tanpa menyimpannya di kolom 'role'
            $user->assignRole($role);
        }
    }
